import Vue from "vue";
import App from "./App.vue";

import "bootstrap/dist/css/bootstrap.min.css";
import "./assets/fontawesome/css/all.min.css";
import "./assets/fontawesome/js/all.min.js";

Vue.config.productionTip = false;

new Vue({
  render: h => h(App),
}).$mount('#app');
